function BtnOfMenu() {
  const categories = ["ALL", "COFFEE", "BEVERAGE", "TEA"];

  return (
    <div className={styles.menuCateBtnWrap}>
      {categories.map((btn) => {
        return btn;
      })}
    </div>
  );
}

export default BtnOfMenu;
